SELECT MAX("lineorder"."lo_custkey" + "lineorder"."lo_shippriority") as agg_0, MIN("part"."p_partkey" + "dim_date"."d_weeknuminyear") as agg_1 FROM "dim_date" LEFT OUTER JOIN "lineorder" ON "dim_date"."d_datekey" = "lineorder"."lo_orderdate" LEFT OUTER JOIN "part" ON "lineorder"."lo_partkey" = "part"."p_partkey"  WHERE "dim_date"."d_lastdayinmonthfl" = 1 AND "lineorder"."lo_orderpriority" IN ('3-MEDIUM', '2-HIGH', '5-LOW') AND "lineorder"."lo_orderpriority" = '3-MEDIUM' AND ("dim_date"."d_monthnuminyear" = 11 OR "dim_date"."d_dayofweek" LIKE '%T%hursday%' OR "dim_date"."d_monthnuminyear" >= 5) AND ("lineorder"."lo_shipmode" IN ('AIR', 'REG AIR', 'MAIL', 'FOB', 'RAIL') OR "lineorder"."lo_shipmode" NOT LIKE '%AIR%')